import APIHandler from "./APIHandler.js";

class APISimulation extends APIHandler {
  async getTimeline(_date, _time) {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/warehouse/timeline?date=" +
          _date +
          "&time=" +
          _time
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }
}

export default APISimulation;
